import React, { useEffect, useState } from 'react'
import { useAuth } from '../Context/AuthContext'
import axios from 'axios';

const Dashboard = () => {
    const {authuser} = useAuth();
    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const route = "http://localhost:5000";  
    useEffect(() => {
        // Fetch data from the API endpoint
        axios.get(route+'/api/getteacher') // Replace with your actual API endpoint
            .then(response => {
                setData(response.data);
                setLoading(false);
            })
            .catch(error => {
                console.error('There was an error fetching the data!', error);
                setError(error);
                setLoading(false);
            });
    }, []); // Empty dependency array to run once on component mount
    if (loading) return <p>Loading...</p>;
    if (error) return <p>There was an error loading the data!</p>;
  return (<>
  
  {authuser && <nav class="navbar navbar-expand-lg navbar-light bg-light">
  <a class="navbar-brand" href="#"></a>
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>
  <div class="collapse navbar-collapse" id="navbarNav">
    <ul class="navbar-nav">
      <li class="nav-item active">
        <a class="nav-link" href="/adduser">Add Student or Teacher</a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Create a classroom</a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Classrooms </a>
      </li>
      <li class="nav-item">
        <a class="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Disabled</a>
      </li>
    </ul>
  </div>
</nav>}<div>Dashboard</div>
<div className="container mt-5">
            <h2>Data Table (students)</h2>
            <table className="table table-dark table-bordered">
                <thead className='thead-light mt-1'>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Age</th>
                        <th>Date of Birth</th>
                        <th>Email</th>
                        <th>Password</th>
                        <th>Role</th>
                        <th>Version</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map((item, index) => (
                        <tr key={index}>
                            <td>{item._id}</td>
                            <td>{item.name || 'N/A'}</td>
                            <td>{item.age || 'N/A'}</td>
                            <td>{item.dob || 'N/A'}</td>
                            <td>{item.email}</td>
                            <td>{item.password}</td>
                            <td>{item.role}</td>
                            <td>{item.__v}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
  </>
    
    
  )
}

export default Dashboard
